    },
  });

function App() {
  return (
    <>

<ThemeProvider></ThemeProvider>
        <LocalizationProvider dateAdapter={AdapterDayjs}>
          <RoomProvider>
            <Header />
            <Router />
            <Footer />
          </RoomProvider>
        </LocalizationProvider>
    </>
  );
}

export default App;
